import { useParams, useNavigate } from "react-router-dom";
import '../../App.css';
import Navbar from '../Navbar/Navbar'

function Greetings() {

    const navigator = useNavigate()
    function doNavigate(){
        navigator('/')
    }

    const params = useParams();
    
    return (
    <div>
        <div className="customBg">
            <Navbar />
            <div className='container customArea'>
              <p className='customText'>Hola Globo</p>
              <div className='row'>
                <div className='col'>
                  <div className='container bg-white rounded'>
                        <h1>Hello {params.name}</h1>
                        <button className='btn text-white rounded mb-2' style={{ backgroundColor: '#531251' }} onClick={doNavigate}>Home Page</button> {/*done with programatic navigator (useNavigate)*/}
                  </div>
                </div>
              </div>
            </div>
        </div>
    </div>
);
}

export default Greetings;
